import React from 'react';
import Navbar from './Navbar';
import SearchForm from './SearchForm';
import ListingFullWidth from './ListingFullWidth';

function App() {
  return (
    <div className="App">
      <header className="hero">
        <Navbar />
        <SearchForm />
      </header>
        <ListingFullWidth />
    </div>
  );
}

export default App;
